import React from "react";
import styled from "styled-components";
import { Link } from "react-router-dom";

const Header = (props) => {
    console.log(props);
    return (
    <React.Fragment>
      <Title>
          Gaesi-pan
      </Title>

      <Buttonset>

        <Link to="/">
        <Button >모든 포스팅</Button>
        </Link>
        <Link to="/write">
        <button style={{width: 400}}>글쓰기</button>
        </Link>
        <Link to="/intro">
        <Button >소개</Button>
        </Link>
      </Buttonset>

      <hr style={{width: 1200, }}/>
    </React.Fragment>
  );
};
const Button = styled.button`
height: 40px;
width: 200px;
margin: 20px;
`;
const Title = styled.h1`
text-align: center;
font-size: 60px;
margin: 50px auto;
`;

const Buttonset = styled.div`
text-align: center;
margin: 0 auto;
`;
export default Header;
